// App.js

import React from 'react';
import { BrowserRouter as Router, Route, Lik } from 'react-router-dom';
import Home from './components/home/home.tsx';

function App() {
  return (
    <Router>
      <Switch>
        <div className="App">
          <Route path="/" component={Home} exact />
        </div>
      </Switch>
    </Router>
  );
}

export default App;
